import {Carousel} from "./layouts/HomePage/Carousel";
import {Heros} from "./layouts/HomePage/Heros";
import {LibServ} from "./layouts/HomePage/LibServ";

function App() {
  return (
      <div>
    <Navbar/>
    <ExploreTop/>
        <Carousel/>
        <Heros/>
          <LibServ/>
          <Footer/>
      </div>
  );
}

export default App;
